import React, { Component } from "react";

import { Heading, Container, SubHeading, Button, Span } from "./styles";
import { useParams, useHistory } from "react-router-dom";
import Typist from "react-typist";

export interface Props {
  match: {
    params: {
      id: String;
    };
  };
}

interface State {
  id: string;
}

class PersonBio extends React.Component<Props, State> {
  constructor(props) {
    super(props);
    this.state = { id: null };
  }
  componentDidMount() {
    const { id } = this.props.match.params;

    fetch("https:");
  }
  render() {
    return <div></div>;
  }
}

export default PersonBio;

